import React from "react";

const Weather=props =>(
    <div className="okoshko">
        { props.city  &&
        <div>
            <p> Местоположение : {props.city}</p>
            <p> Температура : {props.temp}</p>
            <p> Восход солнца: {props.sunrise}</p>
            <p> Закат : {props.sunset}</p>
        </div>
        }
        <p>{props.error}</p>
    </div>
)
export default Weather;
